import "./App.css";
import Greet from "./components/Greet";
import Welcome from "./components/Welcome";
function App() {
  return (
    <div className="App">
      <Greet name="duy" heroName="Batman">
        <p>this is children</p>
      </Greet>
      <Greet name="lam" />
      <Greet name="huynh" />
      <Welcome name="jasdfjhashj" heroName="Batman"></Welcome>
    </div>
  );
}

export default App;
